import './Event.css';
function Event(props){
  return(

  <div className='train'>or babu
     <div class='train2'>
              <p>
              name:-<font color='blue'>{props.name}</font>
              <br/>
              price : <font color ='pink'>{props.price}</font><br/>
              date : <font color='Red'>{props.date}</font><br/>
              Location: <font color='Red'>{props.Location}</font>
              
            </p>
            </div>
            <div className='train1'></div>
  </div>




  );
}      export default Event;
